import React from 'react';
import { Navigation, Buttons, Boxes } from '../../components';
import './ongoing.css';

const OnGoing = () => {
  return (
    <div className='flex flex-col items-center justify-start min-h-screen px-5 pt-20 space-y-6 overflow-y-auto'>
      <div className='flex items-center justify-between w-full mb-5'>
        <Buttons context='back' className='mr-6' />
        <h1 className='text-black text-2xl'>On Going</h1>
      </div>

      <div className='flex flex-col space-y-5 box relative w-300 bg-tertiary overflow-hidden'>
        <Boxes />
      </div>

      <Navigation />
    </div>
  );
};

export default OnGoing;
